import React from "react";
import "./Page.scss";

function Articles() {
  return (
    <div className="ArticlesWrapper">
      <div className="Art Art1">
        <a href="/articles/1"></a>
        <div className="ArtContent">
          <h2>Test 1</h2>
          <p>Résumé bref de test 1</p>
        </div>
      </div>

      <div className="Art Art2"></div>
      <div className="Art Art3"></div>
      <div className="Art Art4"></div>
      <div className="Art Art5"></div>
      <div className="Art Art6">
        <a href="/articles/6"></a>
      </div>
      <div className="Art Art7">
        <a href="/articles/7"></a>
      </div>
    </div>
  );
}
export default Articles;
